package ra.dev.model.dto;public class OrderdtailDTO {    private Integer detailId;    private Integer price;    private String productName;    private Integer quantity;    private Integer orderId;    private Integer productId;    public Integer getDetailId() {        return this.detailId;    }    public void setDetailId(Integer detailId) {        this.detailId = detailId;    }    public Integer getPrice() {        return this.price;    }    public void setPrice(Integer price) {        this.price = price;    }    public String getProductName() {        return this.productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public Integer getQuantity() {        return this.quantity;    }    public void setQuantity(Integer quantity) {        this.quantity = quantity;    }    public Integer getOrderId() {        return this.orderId;    }    public void setOrderId(Integer orderId) {        this.orderId = orderId;    }    public Integer getProductId() {        return this.productId;    }    public void setProductId(Integer productId) {        this.productId = productId;    }}